import React from 'react';
import PropTypes from 'prop-types';
import dino from '../img/dinoLove.svg'
import { Panel, PanelHeader, Header, Button, Group, Cell, Div, Avatar, Image } from '@vkontakte/vkui';

const Home = ({ id, go, fetchedUser }) => (
	<Panel id={id}>
		<PanelHeader>..и немного о важном</PanelHeader>


		<Group className={'Container'}>

			<Div className={'Greeting'}>
				<img className={'Dino'} src={dino} />
				<Div><p> {`привет, ${fetchedUser.first_name}`}</p>
					<p> сегодня поговорим о важном...</p>
					<p> насколько твои друзья любят котиков</p>
				</Div>
			</Div>
		</Group>

		<Button stretched size="4" mode="secondary" onClick={go} data-to="persik">
			Поехали
		</Button>
		{/* {fetchedUser &&
			<Group header={<Header mode="secondary">User Data Fetched with VK Bridge</Header>}>
				<Cell
					before={fetchedUser.photo_200 ? <Avatar src={fetchedUser.photo_200} /> : null}
					subtitle={fetchedUser.city && fetchedUser.city.title ? fetchedUser.city.title : ''}
				>
					{`привет, ${fetchedUser.first_name}`}
				</Cell>
			</Group>}

		<Group header={<Header mode="secondary">Navigation Example</Header>}>
			<Div>
				<Button stretched size="l" mode="secondary" onClick={go} data-to="persik">
					Show me the Persik, please
				</Button>
			</Div>
		</Group> */}
	</Panel>
);


Home.propTypes = {
	id: PropTypes.string.isRequired,
	go: PropTypes.func.isRequired,
	fetchedUser: PropTypes.shape({
		photo_200: PropTypes.string,
		first_name: PropTypes.string,
		last_name: PropTypes.string,
		city: PropTypes.shape({
			title: PropTypes.string,
		}),
	}),
};

export default Home;
